// This is Contact component, it will contain contact form.
import React from "react";
import styled from "styled-components";

const ContactSection = styled.div`
width:100vw;
`
const Title = styled.h1`
display: inline-block;
font-size: calc(1rem + 1.5vw);
margin-top: 1rem;
position: relative;

&::before {
  content: '';
  height: 1px;
  width: 50%;
  position: absolute;
  left: 50%;
  bottom: 0;
  border-bottom: 2px solid var(--purple)
  transform: translate(-50%);
}
`
const Contact = () => {
  return <ContactSection>
    <Title>Request Service</Title>
    <Icons>
      <a href="https://www.yelp.com/biz/major-appliance-repair-everett-2">
        <img src="Agency-website/src/MySite/yelp.png" alt="Yelp" />
      </a>
      <a href="https://goo.gl/maps/ZLRVKagXNCkL9GPL9">
        <img src="Agency-website/src/MySite/googlemaps.png" alt="Google" />
      </a>

    </Icons>
  </ContactSection>;
};

export default Contact;
